import Header from "../../components/Header/Header";

function ServicePage(props) {
  return (
    <>
      <Header
        text={props.text.header}
        languages={props.languages}
        curLang={props.currLang}
        setLanguage={props.setLanguage}
        links={props.links}
      ></Header>

    </>
  );
}

export default ServicePage;
